        }

        const data: Review[] = await response.json();
        setReviews(data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchReviews();
  }, []);
  const dogruns = favorites.filter((fav) => fav.store_type === 1);
  const dogcafes = favorites.filter((fav) => fav.store_type === 2);
  const petshops = favorites.filter((fav) => fav.store_type === 3);
  const hospitals = favorites.filter((fav) => fav.store_type === 4);

  console.log("üê∂ „Éâ„ÉÉ„Ç∞„É©„É≥:", dogruns);
  console.log("‚òï „Éâ„ÉÉ„Ç∞„Ç´„Éï„Çß:", dogcafes);
  console.log("üõçÔ∏è „Éö„ÉÉ„Éà„Ç∑„Éß„ÉÉ„Éó:", petshops);
  console.log("üè• ÂãïÁâ©ÁóÖÈô¢:", hospitals);

  // Â∫óËàó„ÅÆÁ®ÆÈ°û„Å´Âøú„Åò„Åü„Éö„Éº„Ç∏„ÅÆÈÅ∑ÁßªÂÖà„ÇíÂèñÂæó
  const getCategoryPath = (storeType: number, storeId: number) => {
    switch (storeType) {
      case 1:
        return `/dogrun/detail/${storeId}`;
      case 2:
        return `/dogcafe/detail/${storeId}`;
      case 3:
        return `/petshop/detail/${storeId}`;
      case 4:
        return `/hospital/detail/${storeId}`;
      default:
        return `/detail/${storeId}`;
    }
  };
  // „Ç´„ÉÜ„Ç¥„É™„Éº„Åî„Å®„Å´Ë°®Á§∫„Åô„ÇãÈñ¢Êï∞
  const renderCategory = (storeType: number, title: string) => {
    const items = favorites.filter((fav) => fav.store_type === storeType);

    return (
      <section key={storeType}>
        <h2 className="category-title">{title}</h2>
        {items.length > 0 ? (
          <ul className="favorite-list">
            {items.map((favorite) => {
              // ÂØæË±°ÂïÜÂìÅ„ÅÆÂè£„Ç≥„Éü„Éá„Éº„Çø„ÇíÂèñÂæó
